    onTxtQ1aIDBlur: function(component, e, eOpts) {
        var a_value = component.getValue();
        if(a_value == '0'){
            Ext.getCmp('txtQ1bID').enable();
           }
        else if(a_value === '')
        {
            Ext.getCmp('txtQ1bID').enable();
        }
        else{
              Ext.getCmp('txtQ1bID').disable();
        }

        if(component.getValue() >= '56' && component.getValue() <='59' ){
             Ext.getCmp('txtQ1bID').disable();

            Ext.getCmp('ddlQ7ID').enable();
            Ext.getCmp('ddlQ8ID').enable();
            Ext.getCmp('ddlQ9ID').enable();
            Ext.getCmp('ddlQ7ID').allowBlank = false;
            Ext.getCmp('ddlQ7ID').validate();
            Ext.getCmp('ddlQ8ID').allowBlank = false;
            Ext.getCmp('ddlQ8ID').validate();
            Ext.getCmp('ddlQ9ID').allowBlank = false;
            Ext.getCmp('ddlQ9ID').validate();

        }
        else if (Ext.getCmp('txtQ1bID').getValue() === '89') {
             Ext.getCmp('txtQ1aID').disable();
            Ext.getCmp('ddlQ7ID').enable();
            Ext.getCmp('ddlQ8ID').enable();
            Ext.getCmp('ddlQ9ID').enable();
            Ext.getCmp('ddlQ7ID').allowBlank = false;
            Ext.getCmp('ddlQ7ID').validate();
            Ext.getCmp('ddlQ8ID').allowBlank = false;
            Ext.getCmp('ddlQ8ID').validate();
            Ext.getCmp('ddlQ9ID').allowBlank = false;
            Ext.getCmp('ddlQ9ID').validate();
        }
            else{


                Ext.getCmp('ddlQ7ID').disable();
                Ext.getCmp('ddlQ8ID').disable();
                Ext.getCmp('ddlQ9ID').disable();


                Ext.getCmp('ddlQ7ID').setValue('');
                Ext.getCmp('ddlQ8ID').setValue('');
                Ext.getCmp('ddlQ9ID').setValue('');

                Ext.getCmp('ddlQ7ID').allowBlank = true;
                Ext.getCmp('ddlQ7ID').validate();
                Ext.getCmp('ddlQ8ID').allowBlank = true;
                Ext.getCmp('ddlQ8ID').validate();
                Ext.getCmp('ddlQ9ID').allowBlank = true;
                Ext.getCmp('ddlQ9ID').validate();
            }
    },

