    onTxtSectionASupplierNPIBlur: function(component, e, eOpts) {
        var input = component.getValue();
             var txtSectionASupplierNPIID =  Ext.getCmp('txtSectionASupplierNPIID');
        var supplierNametxt =  Ext.getCmp('suppdes');
        if(txtSectionASupplierNPIID.value !== ''){
        // Success
                var successCallback = function(resp, ops) {
                    console.log('supp '+resp.responseText);
                    if(resp.responseText != 'false'){
                      supplierNametxt.setValue(Ext.JSON.decode(resp.responseText));
                   }
                   else{
                        txtSectionASupplierNPIID.setValue('');
                       supplierNametxt.setValue('');
                      Ext.Msg.alert("No Match Found", 'Supplier NPI is not in our record');
                   }


                };

                // Failure
                var failureCallback = function(resp, ops) {

                    // Show login failure error
                    //Ext.Msg.alert("Login Failure", 'Incorrect Username or Password');

                };


                // TODO: Login using server-side authentication service
                Ext.Ajax.request({url: "services/SectionA.php?action=fetchSupplierName&SNPI="+input,
                        method: 'GET',
                        params: input,
                        success: successCallback,
                        failure: failureCallback
                 });

        }
        else{
            supplierNametxt.reset();
        }
    },

